import styled from "styled-components"


export const Container = styled.header`
    background: var(--purple-light);
    height: auto;
`;

export const Content = styled.div`
    max-width: 1120px;
    margin: 0 auto;

    padding: 2rem 1rem 0rem;
    display: flex;


    h1{
        font-style: normal;
